import React from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';
import { Transaction, TransactionType } from './stories/Transaction';
import { TransactionList } from './stories/TransactionList';

const transactions: Transaction[] = [
  {
    id: '987e057d-fb96-4c98-8fdc-907ea7854eb7',
    type: TransactionType.CREDIT,
    amount: 100,
    effectiveDate: '2020-10-12T23:56:39.607Z',
  },
  {
    id: '987e057d-fb96-4c98-8fdc-907ea7854eb7',
    type: TransactionType.DEBIT,
    amount: 50,
    effectiveDate: '2020-10-12T23:56:39.607Z',
  }
]

class App extends React.Component {
  constructor(props: any) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        {/*<header className="App-header">*/}
        {/*  <img src={logo} className="App-logo" alt="logo" />*/}
        {/*  Getting transactions, please wait*/}
        {/*</header>*/}
        <TransactionList transactions={transactions}></TransactionList>
      </div>
    );
  }
}

export default App;
